import { BrowserRouter, Routes, Route } from 'react-router-dom'

// Pages and components
import home from './pages/Home'


function App() {
  return (
    <div className="App">
     <BrowserRouter>
     <div className="pages">
      <Routes>
        <Route
        path="/"
        element={<Home />}
        />
      </Routes>
      </div>     
     </BrowserRouter>
    </div>
  );
}

export default App;
